// pages/RegistrationScreen.js
import React, { useState } from 'react';
import { View, Text } from 'react-native';
import TextInputField from '../components/register/textInputField';
import PickerField from '../components/register/pickerField';

export default function RegistrationScreen() {
  const [username, setUsername] = useState('');
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [password, setPassword] = useState('');
  const [userType, setUserType] = useState('');

  const handleRegister = () => {
    // Implement registration logic here
    console.log('Registering user:', { username, firstName, lastName, phoneNumber, password });
  };

  const userTypeOptions = [
    { label: 'Select User Type', value: '' },
    { label: 'Therapist', value: 'therapist' },
    { label: 'Treated', value: 'treated' },
  ];

  return (
    <View>
      <Text>User Name</Text>
      <TextInputField
        value={username}
        onChangeText={setUsername}
        placeholder="Enter your username"
      />
      <Text>First Name</Text>
      <TextInputField
        value={firstName}
        onChangeText={setFirstName}
        placeholder="Enter your firstName"
      />
      <Text>Last Name</Text>
      <TextInputField
        value={lastName}
        onChangeText={setLastName}
        placeholder="Enter your lastName"
      />
      <Text>Phone Number</Text>
      <TextInputField
        value={phoneNumber}
        onChangeText={setPhoneNumber}
        placeholder="Enter your phoneNumber"
      />
      <Text>Password</Text>
      <TextInputField
        value={password}
        onChangeText={setPassword}
        placeholder="Enter your password"
        secureTextEntry
      />
      <Text>User Type</Text>
      <PickerField
        selectedValue={userType}
        onValueChange={(itemValue) => setUserType(itemValue)}
        items={userTypeOptions}
      />
      <RegisterPressable onPress={handleRegister} title="Register" />
    </View>
  );
};
